window.onload=()=>{var t=document.querySelectorAll(".nav-link");const n=document.querySelector(".transition");setTimeout(()=>{n.classList.remove("is-active")},200);for(let e=0;e<t.length;e++){const a=t[e];console.log(t),a.addEventListener("click",e=>{e.preventDefault();let t=e.target.href;n.classList.add("is-active"),setInterval(()=>{window.location.href=t},200)})}};const menuBtn=document.querySelector("#navbar-toggle"),menuNav=document.querySelector("#navbar-nav");menuBtn.onclick=function(){menuNav.classList.toggle("active"),menuBtn.classList.toggle("active"),menuBtn.setAttribute("aria-expanded","true"==menuBtn.getAttribute("aria-expanded")?"false":"true")},menuBtn.onkeydown=function(e){"Enter"==e.key&&(menuNav.classList.toggle("active"),e.preventDefault(),menuBtn.setAttribute("aria-expanded","true"==menuBtn.getAttribute("aria-expanded")?"false":"true"))};